<?php

namespace App\Models;

use Illuminate\Database\Eloquent\Factories\HasFactory;
use Illuminate\Database\Eloquent\Model;

class Part extends Model
{
    use HasFactory;
    protected $fillable = [
        'code_part', 
        'subcategory_id',
        'bibliographic_name',
        'common_name_1',
        'common_name_2',
        'image',
    ];

    public function getImageAttribute($value)
    {
        if($value){
            return $value;
        } else {
            return '';
        }
    }
}
